attack = ""
i = 0
for line in f:
	i += 1
	if i%16 == 0:
		value = line.split(",")[0].decode("hex")
		attack += value[:16]

flag = ""
for i in range(len(attack)):
	flag += chr(ord(attack[i]) ^ ord(secret[i]) ^ 16)

